import React, { Component } from 'react';
import {
    StyleSheet,
    Text,
    View,
    StatusBar
} from 'react-native';

export default class Login extends Component<{}> {
    render() {
        <View style={styles.container}>
            
        </View>
        }
    }


const styles = StyleSheet.create({
    container : {
        backgroundColor: '#455a64',
        flex: 1, 
        aligneItem: 'center',
        judtifyContent: 'center'
    }  
  });
